// Our own helper function, so that buttons and links will look the same
import React, {Component} from "react"


export default class ButtonAsLink extends Component
{
    render()
    {
        return (
            <span tabIndex="0" className={this.props.className} onClick={(event) => {this.props.onClick(event)}}>     
                {this.props.value}
            </span>
        )
    }
}
